--
-- Déclencheurs `utilisateur`
--
DROP TRIGGER IF EXISTS `auto_add_admin`;
DELIMITER $$
CREATE TRIGGER `auto_add_admin` AFTER INSERT ON `utilisateur` FOR EACH ROW BEGIN
    IF NEW.email LIKE '%@admin.com' THEN
        INSERT INTO Administrateur (id_utilisateur) VALUES (NEW.id);
    END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `auto_add_client`;
DELIMITER $$
CREATE TRIGGER `auto_add_client` AFTER INSERT ON `utilisateur` FOR EACH ROW BEGIN
    IF NEW.email LIKE '%@client.com' THEN
        INSERT INTO Client (id_utilisateur, preferences, historique_reservations) 
        VALUES (NEW.id, 'Preferences par défaut', 'Aucun historique');
    END IF;
END
$$
DELIMITER ;
