(336, 'frm_addons_l', 'a:3:{s:7:\"timeout\";i:1726091417;s:5:\"value\";s:120174:\"{\"93790\":{\"title\":\"Formidable Pro\",\"name\":\"Formidable Pro\",\"display_name\":\"Formidable Pro\",\"slug\":\"formidable-pro\",\"version\":\"6.12\",\"new_version\":\"6.12\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-pro-6.12.zip\"],\"excerpt\":\"\",\"id\":93790,\"released\":\"2010-02-01 16:27:26\",\"categories\":[\"Basic\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-pro\\/\",\"changelog\":\"<h4>v6.12 - August 21, 2024<\\/h4>\\n<ul>\\n<li>New: The admin entries list page will now only display a preview for the first five entries per repeater. A new <span class=\\\"blob-code-inner blob-code-marker js-code-nav-pass \\\" data-code-marker=\\\"+\\\"><span class=\\\"pl-s\\\">frm_pro_repeated_entries_display_limit<\\/span><\\/span> filter has been introduced to modify this limit if desired.<\\/li>\\n<li>New: Many styling updates were made for fields included in this plugin. Styling for autocomplete dropdowns using Chosen has been updated to improve styling consistency with other field types. The styling for file upload fields has updated. The styling for radio buttons and checkboxes displayed as images has been updated.<\\/li>\\n<li>New: New fields will now be immediately inserted into the list of options in field shortcode pop up for various field settings including HTML field descriptions and AI field questions.<\\/li>\\n<li>New: Entry comments can now be imported when importing entries with a CSV file.<\\/li>\\n<li>Fix: Submit button conditional logic would fail when setting the submit button position setting to none.<\\/li>\\n<li>Checks have been added to no longer include fields with form state on servers where open SSL is not installed. This is to improve compatibility.<\\/li>\\n<li>The setting to include jQuery CSS on all pages has been removed. On sites that still had this setting enabled, the jQuery CSS will no longer load on all pages.<\\/li>\\n<li>Several old deprecated view files includes in the frmpro-fields folder have been removed.<\\/li>\\n<li>Many old deprecated functions have been removed including FrmProStylesController::<span class=\\\"blob-code-inner blob-code-marker js-code-nav-pass js-skip-tagsearch\\\" data-code-marker=\\\"-\\\"><span class=\\\"pl-en\\\">get_datepicker_names<\\/span><\\/span>, FrmProStylesController::<span class=\\\"blob-code-inner blob-code-marker js-code-nav-pass js-skip-tagsearch\\\" data-code-marker=\\\"-\\\"><span class=\\\"pl-en\\\">progress_settings_file<\\/span><\\/span>, FrmProStylesController::<span class=\\\"blob-code-inner blob-code-marker js-code-nav-pass js-skip-tagsearch\\\" data-code-marker=\\\"-\\\"><span class=\\\"pl-en\\\">date_settings_file, FrmProStylesController::section_fields_file, FrmProFieldsHelper::get_default_html, FrmProFieldsHelper::value_meets_condition, FrmProXMLHelper::get_file_id, FrmProXMLHelper::get_date, FrmProXMLHelper::get_multi_opts, FrmProXMLHelper::get_dfe_id, FrmProAddonsController::show_expired_message, FrmProAddonsController::expiring_message, FrmProComboFieldsController::include_inplace_sub_label, FrmProComboFieldsController::add_default_options, FrmProFieldsController::add_separate_value_opt_label, FrmProFieldsController::show_normal_field, FrmProFieldsController::normal_field_html, FrmProFieldsController::show_other, FrmProLookupFieldsController::show_lookup_field_options_in_form_builder, FrmProLookupFieldsController::show_get_options_from_above_field_options, FrmProLookupFieldsController::maybe_add_autocomplete_class, FrmProLookupFieldsController::get_lookup_options_for_insert_fields_tab, FrmProLookupFieldsController::add_field_options_specific_to_lookup_field, FrmProAppHelper::get_time_format_for_field, FrmProAppHelper::get_time_format_for_setting, and FrmProFieldsHelper::maybe_get_hidden_dynamic_field_inputs.<\\/span><\\/span><\\/li>\\n<\\/ul>\\n<h4>v6.11.2 - July 30, 2024<\\/h4>\\n<ul>\\n<li>New: Translations have been added for German, Spanish, French, Italian, Brazilian Portuguese and Japanese. Several incorrect text domains and untranslatable strings have also been corrected.<\\/li>\\n<li>Fix: A date check for NOW in conditional shortcodes was misspelled as <span class=\\\"blob-code-inner blob-code-marker js-code-nav-pass js-skip-tagsearch\\\" data-code-marker=\\\"-\\\"><span class=\\\"pl-s\\\"><span class=\\\"x x-first x-last\\\">nOW<\\/span><\\/span><\\/span>. The check has now been made case insensitive.<\\/li>\\n<li>Fix: Extra spaces would cause file type options to appear with additional spaces before commas like png , gif.<\\/li>\\n<li>Fix: Radio buttons displayed as images would appear clipped in the visual styler preview.<\\/li>\\n<li>Fix: Plugin translations would not work without a license set.<\\/li>\\n<li>Fix: Missing submit button HTML required for supporting the Start Over button will now be added automatically when enabling the Start Over button setting. Previously, old forms including old form templates would not show a Start Over button because the custom HTML was missing.<\\/li>\\n<li>Fix: The white label setting to hide the dashboard video would only work when using a non-Formidable menu name.<\\/li>\\n<\\/ul>\\n<h4>v6.11.1 - July 9, 2024<\\/h4>\\n<ul>\\n<li>New: A query for post IDs has been optimized, significantly improving the performance of searches in Views when there are a lot of entries without associated posts.<\\/li>\\n<li>Fix: The icon to remove an Other option or Product option was missing by mistake after last release.<\\/li>\\n<li>Fix: The exclude_fields shortcode option would not work as expected when using a form key for the id attribute value.<\\/li>\\n<li>Fix: A conflict where duplicate frm_folder_icon icons were used in applications has been fixed.<\\/li>\\n<li>The functions FrmProDisplaysHelper::prepare_duplicate_view and FrmProDisplaysHelper::get_show_counts are now deprecated.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-pro\\/formidable-pro.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-772x250.png\"},\"search_terms\":\"\",\"is_new\":false},\"163248\":{\"title\":\"Signature\",\"name\":\"Signature\",\"display_name\":\"Digital Signatures\",\"slug\":\"signature\",\"version\":\"3.0.5\",\"new_version\":\"3.0.5\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-signature\\/formidable-signature-3.0.5.zip\"],\"excerpt\":\"Add an electronic signature to your WordPress form. The visitor may write their signature with a trackpad\\/mouse or type it.\",\"id\":163248,\"released\":\"2013-03-04 00:00:00\",\"categories\":[\"Business\",\"Form Functionality\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-signature\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/signature\\/\",\"changelog\":\"<h4>v3.0.5 - August 19, 2024<\\/h4>\\n<ul>\\n<li>New: This plugin now includes translations for French, Spanish, Italian, German, Japanese and Brazilian Portuguese.<\\/li>\\n<li>Fix: A Use of \\\"parent\\\" in callables deprecated message would get logged when loading translations for signature fields.<\\/li>\\n<li>Fix: In some cases old cached signature images would appear after being updated.<\\/li>\\n<li>Old polyfill code for supporting Internet Explorer has been removed.<\\/li>\\n<\\/ul>\\n<h4>v3.0.4 - March 28, 2024<\\/h4>\\n<ul>\\n<li>New: The way CSS is added has been updated for better compatibility with the Snuffleupagus security module.<\\/li>\\n<li>Fix: Scripts were not properly initializing when editing a form with a signature field in-place using the &#091;editlink] shortcode.<\\/li>\\n<li>Fix: Form validation would trigger on signature draw events, causing error messages to appear on other fields early.<\\/li>\\n<li>Fix: An Uncaught Error: Call to undefined method FrmProFieldDefault::get_signature_image_dimension fatal error has been fixed.<\\/li>\\n<li>Front end signature field icons have been updated to no longer use font icons.<\\/li>\\n<\\/ul>\\n<h4>v3.0.3 - June 15, 2023<\\/h4>\\n<ul>\\n<li>New: Added support for a new show=url shortcode option for signature fields.<\\/li>\\n<li>Fix: Icons were not aligning properly for some button size style settings.<\\/li>\\n<li>Fix: Signature fields would overflow when some field size style settings were applied.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-signature\\/signature.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"163255\":{\"title\":\"Math Captcha\",\"name\":\"Math Captcha\",\"display_name\":\"Math Captcha\",\"slug\":\"math-captcha\",\"version\":\"1.15\",\"new_version\":\"1.15\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-math-captcha\\/formidable-math-captcha-1.15.zip\"],\"excerpt\":\"\",\"id\":163255,\"released\":\"2015-10-12 14:00:35\",\"categories\":[],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/math-captcha\\/\",\"changelog\":\"\",\"plugin\":\"math-captcha\\/math-captcha.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"163257\":{\"title\":\"PayPal Standard\",\"name\":\"PayPal Standard\",\"display_name\":\"PayPal Standard\",\"slug\":\"paypal-standard\",\"version\":\"3.09\",\"new_version\":\"3.09\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-paypal\\/formidable-paypal-3.09.zip\"],\"excerpt\":\"Collect instant payments and recurring payments to automate your online business. Calculate a total and send customers on to PayPal.\",\"id\":163257,\"released\":\"2012-09-04 00:00:00\",\"categories\":[\"Business\",\"Ecommerce\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-paypal\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/paypal-standard\\/\",\"changelog\":\"<h4>v3.10 - December 31, 2024<\\/h4>\\n<ul>\\n<li>Fix: An Undefined array key \\\"expire_date\\\" PHP Warning has been fixed.<\\/li>\\n<li>Fix: An Uncaught TypeError: strtotime PHP Fatal error has been fixed.<\\/li>\\n<\\/ul>\\n<h4>v3.09 - July 30, 2019<\\/h4>\\n<ul>\\n<li>New: Account for tax when comparing amounts with the IPN<\\/li>\\n<li>Update form action icon and color<\\/li>\\n<li>Replace call to deprecated function with FrmFieldsHelper::get_user_display_name<\\/li>\\n<li>Requires Formidable v3.0+<\\/li>\\n<\\/ul>\\n<h4>v3.08 - November 18, 2017<\\/h4>\\n<ul>\\n<li>Allow field shortcodes in more payments settings so values can be set from the form: PayPal email, trial amount, repeat period, trial length. This also allows payments to go to other members on your site.<\\/li>\\n<li>Allow regular WordPress shortcodes and Formidable dynamic values (ie [email]) in addition to basic field shortcodes<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-paypal\\/formidable-paypal.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"paypal\",\"is_new\":false},\"168072\":{\"title\":\"Formidable API\",\"name\":\"Formidable API\",\"display_name\":\"Formidable API\",\"slug\":\"formidable-api\",\"version\":\"1.16\",\"new_version\":\"1.16\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-api\\/formidable-api-1.16.zip\"],\"excerpt\":\"Add a full forms API for forms, form fields, views, and entries. Then send submissions to other sites with REST APIs.\",\"id\":168072,\"released\":\"2016-06-08 00:00:00\",\"categories\":[\"Automation\",\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-api\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-api\\/\",\"changelog\":\"<h4>v1.16 - August 21, 2024<\\/h4>\\n<ul>\\n<li>New: This plugin now includes translations for French, Spanish, Italian, German, Japanese and Brazilian Portuguese.<\\/li>\\n<li>New: A new frm_api_allow_create_entry filter has been added to override errors permission errors when creating an entry using the REST API.<\\/li>\\n<li>New: The frm_api_request_args filter is now applied when testing a connection to make testing a connection more consistent with real requests that get sent.<\\/li>\\n<\\/ul>\\n<h4>v1.15 - February 20, 2024<\\/h4>\\n<ul>\\n<li>New: New stats endpoints have been added. These are used like yoursite.com\\/wp-json\\/frm\\/v2\\/stats\\/{type}\\/{field_id} where type can be any of the type values defined in https:\\/\\/formidableforms.com\\/knowledgebase\\/add-field-totals-and-statistics\\/#kb-required-parameters. This means you can use yoursite.com\\/wp-json\\/frm\\/v2\\/stats\\/maximum\\/{field_id}, yoursite.com\\/wp-json\\/frm\\/v2\\/stats\\/minimum\\/{field_id}, yoursite.com\\/wp-json\\/frm\\/v2\\/stats\\/deviation\\/{field_id}, and more.<\\/li>\\n<li>New: Fields now support PATCH requests for updating a field or for updating multiple fields using the API.<\\/li>\\n<li>New: A frm_api_iframe_use_landing_page_url filter has been added. By default, when using script tags to load a form that requires an iframe, an applicable landing page URL will be used. With this new filter, this can be disabled using add_filter( \'frm_api_iframe_use_landing_page_url\', \'__return_false\' );.<\\/li>\\n<li>Fix: Entries would not get deleted despite having the \\\"Do not store entries submitted from this form\\\" setting enabled when creating an entry using an API action.<\\/li>\\n<\\/ul>\\n<h4>v1.14 - September 11, 2023<\\/h4>\\n<ul>\\n<li>New: [date] and [user_id] shortcodes are now supported in API actions.<\\/li>\\n<li>New: Fields inside of a repeater are now also deleted when a repeater is deleted through the API endpoint.<\\/li>\\n<li>Fix: A fatal error would happen on front end pages when the Formidable Forms plugin was unavailable.<\\/li>\\n<li>Fix: An undefined array key 1 warning would get logged when trying to make an API request with some invalid header formats.<\\/li>\\n<li>Fix: A fatal error would occur when trying to run migrations when attempting to call a function that doesn\'t exist.<\\/li>\\n<li>Additional validation has been added when deleting a field using an invalid form id.<\\/li>\\n<li>References to old deprecated functions have been updated.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-api\\/formidable-api.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"168456\":{\"title\":\"Upload Importer\",\"name\":\"Upload Importer\",\"display_name\":\"Upload Importer\",\"slug\":\"upload-importer\",\"version\":\"1.0.01\",\"new_version\":\"1.0.01\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-upload-importer\\/formidable-upload-importer-1.0.01.zip\"],\"excerpt\":\"\",\"id\":168456,\"released\":\"2015-10-16 17:05:47\",\"categories\":[\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/upload-importer\\/\",\"changelog\":\"<h4>v1.0.01<\\/h4>\\n<ul>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<\\/ul>\\n<h4>v1.0<\\/h4>\\n<ul>\\n<li>Allow importing of multiple file uploads<\\/li>\\n<li>Replace deprecated mime_content_type with fileinfo<\\/li>\\n<li>Update auto-updating<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"upload-importer\\/upload-importer.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"168460\":{\"title\":\"Twilio\",\"name\":\"Twilio\",\"display_name\":\"Twilio WordPress SMS\",\"slug\":\"twilio\",\"version\":\"1.09\",\"new_version\":\"1.09\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-twilio\\/formidable-twilio-1.09.zip\"],\"excerpt\":\"Allow users to text their votes for polls created by Formidable Forms, or send SMS notifications when entries are submitted or updated.\",\"id\":168460,\"released\":\"2014-03-10 00:00:00\",\"categories\":[\"Business\",\"Email &amp; SMS Marketing\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/twilio-add-on\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/twilio\\/\",\"changelog\":\"<h4>v1.10 - August 26, 2024<\\/h4>\\n<ul>\\n<li>New: This plugin now includes translations for French, Spanish, Italian, German, Japanese and Brazilian Portuguese.<\\/li>\\n<li>New: Twilio requests are now logged using the logging add-on when the plugin is available.<\\/li>\\n<li>New: Twilio actions now include the option to trigger on import.<\\/li>\\n<\\/ul>\\n<h4>v1.09 - November 2, 2020<\\/h4>\\n<ul>\\n<li>New: Include sending numbers from the linked Twilio account in a dropdown. This makes it much easier to send messages successfully.<\\/li>\\n<li>New: Process the [default-message] when sending in an SMS message.<\\/li>\\n<li>Add more guidance to connect to the Twilio API and show messages in the form action when connecting fails.<\\/li>\\n<li>Fix: Some responses were not getting saved correctly into radio and checkbox fields.<\\/li>\\n<li>Clean up and update the code including removing support for Formidable &lt;2.0.<\\/li>\\n<\\/ul>\\n<h4>v1.08 - January 16, 2017<\\/h4>\\n<ul>\\n<li>Improved: Removed deprecated instructions and screenshot.<\\/li>\\n<li>Improved: Removed deprecated valign attribute from table HTML.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-twilio\\/formidable-twilio.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"168463\":{\"title\":\"Bootstrap\",\"name\":\"Bootstrap\",\"display_name\":\"Bootstrap\",\"slug\":\"bootstrap\",\"version\":\"2.0.1\",\"new_version\":\"2.0.1\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-bootstrap\\/formidable-bootstrap-2.0.1.zip\"],\"excerpt\":\"Instantly add Bootstrap styling to all your Formidable forms.\",\"id\":168463,\"released\":\"2014-08-05 00:00:00\",\"categories\":[\"Creator\",\"Form Design &amp; Display\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-bootstrap\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/bootstrap\\/\",\"changelog\":\"<h4>v2.0.1 - August 13, 2024<\\/h4>\\n<ul>\\n<li>New: This plugin now includes translations for French, Spanish, Italian, German, Japanese and Brazilian Portuguese.<\\/li>\\n<\\/ul>\\n<h4>v2.0 - November 30, 2023<\\/h4>\\n<ul>\\n<li>New: This add on now uses Bootstrap 5 (instead of Bootstrap 3). If moving to Bootstrap 5 is causing issues, the option to change back to Bootstrap 3 is available as a dropdown option in Global Settings.<\\/li>\\n<li>New: Admin page labels for Bootstrap settings have been updated for better accessibility.<\\/li>\\n<li>Fix: Radio button options displayed as buttons had too much left padding when using Bootstrap 3.<\\/li>\\n<li>Fix: Too many migration queries were being made when there was no Bootstrap data to migrate.<\\/li>\\n<li>Fix: The ellipses used in pagination containers was appearing as text outside of the pagination when using the Bootstrap add on.<\\/li>\\n<\\/ul>\\n<h4>vv1.03 - January 18, 2021<\\/h4>\\n<ul>\\n<li>This update requires action. After updating, click the link to migrate the old settings.<strong> If you save a form with Bootstrap field options before running this migration, you risk losing those settings.<\\/strong><\\/li>\\n<li>New: Moved Prepend and Append Bootstrap field options to Before Input and After Input.<\\/li>\\n<li>New: Errors are now shown by default and can no longer be turned off<\\/li>\\n<li>New: Improved plugin security<\\/li>\\n<li>New: Added bootstrap CSS file directly into plugin for GDPR compliance<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-bootstrap\\/formidable-bootstrap.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"168468\":{\"title\":\"AWeber\",\"name\":\"AWeber\",\"display_name\":\"AWeber\",\"slug\":\"aweber\",\"version\":\"2.05\",\"new_version\":\"2.05\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-aweber\\/formidable-aweber-2.05.zip\"],\"excerpt\":\"AWeber is a powerful email marketing service. Subscribe contacts to an AWeber mailing list when they submit your WordPress contact forms.\",\"id\":168468,\"released\":\"2013-11-26 00:00:00\",\"categories\":[\"Creator\",\"Email &amp; SMS Marketing\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-aweber\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/aweber\\/\",\"changelog\":\"<h4>v2.05 - August 20, 2024<\\/h4>\\n<ul>\\n<li>New: This plugin now includes translations for French, Spanish, Italian, German, Japanese and Brazilian Portuguese.<\\/li>\\n<li>Fix: Undefined array key \\\"ad_tracking\\\" and Undefined array key \\\"tags\\\" PHP warnings have been fixed when adding a new AWeber action.<\\/li>\\n<li>The deprecated <span class=\\\"blob-code-inner blob-code-marker js-code-nav-pass js-skip-tagsearch\\\" data-code-marker=\\\"-\\\"><span class=\\\"pl-en x x-first\\\">utf8_encode<\\/span><\\/span> PHP function is no longer referenced.<\\/li>\\n<\\/ul>\\n<h4>v2.04 - June 11, 2024<\\/h4>\\n<ul>\\n<li>New: Field dropdowns have been updated to enable support for repeater actions.<\\/li>\\n<li>Fix: Name fields will now properly concatenate the first and last name when sending data to AWeber.<\\/li>\\n<li>Fix: An Uncaught TypeError: preg_match(): Argument 2 must be of type string fatal error has been fixed when trying to remove accents from array data.<\\/li>\\n<\\/ul>\\n<h4>v2.03 - March 3, 2022<\\/h4>\\n<ul>\\n<li>New: Subscription errors and successful subscriptions will now be logged if the Formidable Logs add on is available.<\\/li>\\n<li>Fix: Accents will now be removed from characters when subscribing to avoid issues with special accented characters breaking in names in AWeber.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-aweber\\/formidable-aweber.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"169998\":{\"title\":\"WP Multilingual\",\"name\":\"WP Multilingual\",\"display_name\":\"WP Multilingual\",\"slug\":\"wp-multilingual\",\"version\":\"1.12\",\"new_version\":\"1.12\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-wpml\\/formidable-wpml-1.12.zip\"],\"excerpt\":\"Translate your forms into multiple languages using the Formidable-integrated WPML plugin.\",\"id\":169998,\"released\":\"2013-04-29 00:00:00\",\"categories\":[\"Business\",\"Multilingual\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-multi-language\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/wp-multilingual\\/\",\"changelog\":\"<h4>v1.12 - August 8, 2022<\\/h4>\\n<ul>\\n<li>New: Translations are now copied when a field or form is duplicated.<\\/li>\\n<li>New: Confirmation field validation messages can now be translated.<\\/li>\\n<li>Fix: Placeholders for Lookup dropdowns were not translating.<\\/li>\\n<li>Fix: Updated translations were not properly updating.<\\/li>\\n<\\/ul>\\n<h4>v1.11 - March 25, 2022<\\/h4>\\n<ul>\\n<li>Fix: Likert column headings were not translating properly.<\\/li>\\n<li>Fix: Incorrect and occasionally duplicate field translation options were appearing on translation pages.<\\/li>\\n<li>Fix: Formidable was appearing as an option in the WPML item dropdown, and has been removed.<\\/li>\\n<\\/ul>\\n<h4>v1.10 - July 29, 2021<\\/h4>\\n<ul>\\n<li>New: Placeholders can now be translated for credit card, address, and name fields.<\\/li>\\n<li>New: Options can now be translated for radio, checkbox, and dropdown fields inside of repeaters.<\\/li>\\n<li>Fix: Translations were not properly getting saved if the target language contained an underscore.<\\/li>\\n<\\/ul>\\n<h4>v1.04 - October 25th, 2016<\\/h4>\\n<ul>\\n<li>Allow translation of Add\\/Remove buttons<\\/li>\\n<li>Replace some deprecated WPML function calls and constants<\\/li>\\n<li>Make sure wpml strings are updated when form is updated<\\/li>\\n<li>Do not translate default value for all field types<\\/li>\\n<li>Make sure incorrect field message is translated with ajax submit<\\/li>\\n<\\/ul>\\n<h4>v1.03.03 - March 28, 2016<\\/h4>\\n<ul>\\n<li>Send the language in the ajax url differently to prevent 404s during ajax calls. This should help with duplicate submissions.<\\/li>\\n<li>Prevent a license key from being saved for another plugin<\\/li>\\n<\\/ul>\\n<h4>v1.03.02<\\/h4>\\n<ul>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<li>Make it compatible with the free version of Formidable<\\/li>\\n<li>Fix errors when Formidable or WPML are deactivated<\\/li>\\n<li>Include the current language during ajax calls<\\/li>\\n<li>Force an English start language for strings for v2.2.6 of the WPML strings plugin<\\/li>\\n<li>Fix the issue with the default language in WPML being set different than the string language<\\/li>\\n<li>If values in the form settings page changed, update them when going to the translation settings<\\/li>\\n<li>Make sure the \\\"previous\\\" label is translatable when drafts are not enabled<\\/li>\\n<li>Don\'t show strings for inactive languages<\\/li>\\n<li>Translate fields in repeating sections<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-wpml\\/formidable-wpml.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"170641\":{\"title\":\"Locations\",\"name\":\"Locations\",\"display_name\":\"Locations\",\"slug\":\"locations\",\"version\":\"2.03\",\"new_version\":\"2.03\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-locations\\/formidable-locations-2.03.zip\"],\"excerpt\":\"Populate fields with Countries, States\\/Provinces, U.S. Counties, and U.S. Cities. This data can then be used in dependent Data from Entries fields.\",\"id\":170641,\"released\":\"2014-06-21 00:00:00\",\"categories\":[\"Creator\",\"Data Collection\",\"Form Functionality\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-locations\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/locations\\/\",\"changelog\":\"<h4>v2.03 - April 20, 2023<\\/h4>\\n<ul>\\n<li>Fix: Importing cities would stop at \\\"8 remaining\\\" and never stop making requests to import additional cities.<\\/li>\\n<li>Fix: Form ids are are no longer retrieved using a deprecated function.<\\/li>\\n<li>Fix: Some city values were importing incorrectly, displaying \\\"1920\\\" as the state.<\\/li>\\n<\\/ul>\\n<h4>v2.02 - September 11, 2017<\\/h4>\\n<ul>\\n<li>Fix: Remove invalid city data.<\\/li>\\n<\\/ul>\\n<h4>v2.01 - May 10, 2016<\\/h4>\\n<ul>\\n<li>Switch to using Lookup fields<\\/li>\\n<li>Add a link to reset the locations data<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-locations\\/us_locations.php\",\"icons\":{\"1x\":\"https:\\/\\/formidableforms.com\\/wp-content\\/uploads\\/2013\\/04\\/locations.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"170645\":{\"title\":\"Zapier\",\"name\":\"Zapier\",\"display_name\":\"Zapier\",\"slug\":\"zapier\",\"version\":\"2.04\",\"new_version\":\"2.04\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-zapier\\/formidable-zapier-2.04.zip\"],\"excerpt\":\"Connect with hundreds of applications through Zapier. Automatically insert a Google spreadsheet row, tweet, or upload to Dropbox.\",\"id\":170645,\"released\":\"2014-06-04 00:00:00\",\"categories\":[\"Automation\",\"Business\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-zapier\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/zapier\\/\",\"changelog\":\"<h4>v2.04 - August 19, 2024<\\/h4>\\n<ul>\\n<li>New: This plugin now includes translations for French, Spanish, Italian, German, Japanese and Brazilian Portuguese.<\\/li>\\n<\\/ul>\\n<h4>v2.03 - March 11, 2024<\\/h4>\\n<ul>\\n<li>Fix: When polling for entries, the first entry would always get returned. Now the newest entry is returned as expected.<\\/li>\\n<\\/ul>\\n<h4>v2.02 - March 21, 2023<\\/h4>\\n<ul>\\n<li>New: Referrer checks for protected files are now allowed for Zapier requests so a protected file can be uploaded to Google Drive using a Zapier action. Protected files also need to be available to everyone or Zapier still will not have access.<\\/li>\\n<li>New: Added translation support.<\\/li>\\n<li>Fix: The \\/form API endpoint was calling a deprecated function.<\\/li>\\n<li>Fix: Prevent a fatal error when Formidable lite is inactive.<\\/li>\\n<li>Fix: The link to edit a zap would lead to a 404 page.<\\/li>\\n<li>Additional validation has been added to prevent notices for an incomplete API URL.<\\/li>\\n<li>The message to migrate will no longer be shown when no legacy Zapier posts exist.<\\/li>\\n<li>A warning will now be displayed on any temporary Zapier actions that get created for testing before publishing a zap.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-zapier\\/formidable-zapier.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"170649\":{\"title\":\"User Tracking\",\"name\":\"User Tracking\",\"display_name\":\"User Flow\",\"slug\":\"user-tracking\",\"version\":\"2.0.2\",\"new_version\":\"2.0.2\",\"location\":[\"s3.amazonaws.com\\/fp.strategy11.com\\/releases\\/formidable-user-tracking\\/formidable-user-tracking-2.0.2.zip\"],\"excerpt\":\"Track the pages a user visits and the time spent on each page prior to submitting a form.\",\"id\":170649,\"released\":\"2015-10-19 00:00:00\",\"categories\":[\"Creator\",\"Strategy11\",\"Utilities\"],\"docs\":\"\\/knowledgebase\\/formidable-user-tracking\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/user-tracking\\/\",\"changelog\":\"<h4>v2.0.2 - July 25, 2024<\\/h4>\\n<ul>\\n<li>New: This add-on is now translated in German, Spanish, French, Italian, and Brazilian Portuguese.<\\/li>\\n<li>Fix: Additional checks have been added to fix issues with user sessions starting during REST API requests. This includes an error that would appear on the Site Health page.<\\/li>\\n<li>Fix: More checks have been added to avoid starting sessions when running CLI commands.<\\/li>\\n<\\/ul>\\n<h4>v2.0.1 - June 6, 2024<\\/h4>\\n<ul>\\n<li>New: User flow summaries can now be collapsed and opened by date.<\\/li>\\n<li>New: Forms with no title will now display as (no title) in the user flow summary.<\\/li>\\n<li>Fix: Session start logic has been moved to help avoid a headers already sent PHP warning on admin pages.<\\/li>\\n<li>Fix: A bug has been fixed that would cause incorrect user flow duration values.<\\/li>\\n<\\/ul>\\n<h4>v2.0 - November 1, 2022<\\/h4>\\n<ul>\\n<li>Update the display of the user flow through the site for better readability and more actionable data.<\\/li>\\n<li>Include timestamps in the session tracking so we know how much time was spent on each page.<\\/li>\\n<li>Show the page name for better readability.<\\/li>\\n<li>Add form submissions into session tracking so we know what forms were submitted before this one.<\\/li>\\n<li>Show a summary of how much time between the first time we logged the user and when the form was submitted.<\\/li>\\n<li>Fix: Do not start session when running a Cron.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-user-tracking\\/formidable-user-tracking.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"170655\":{\"title\":\"Mailchimp\",\"name\":\"Mailchimp\",\"display_name\":\"Mailchimp\",\"slug\":\"mailchimp\",\"version\":\"2.08\",\"new_version\":\"2.08\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-mailchimp\\/formidable-mailchimp-2.08.zip\"],\"excerpt\":\"Get on the path to more leads in minutes. Add and update leads in a Mailchimp mailing list when a form is submitted.\",\"id\":170655,\"released\":\"2013-10-17 00:00:00\",\"categories\":[\"Creator\",\"Email &amp; SMS Marketing\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-mailchimp\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/mailchimp\\/\",\"changelog\":\"<h4>v2.08 - September 3, 2024<\\/h4>\\n<ul>\\n<li>New: This plugin now includes translations for French, Spanish, Italian, German, Japanese and Brazilian Portuguese. This does not include dynamic fields loaded from Mailchimp\'s API.<\\/li>\\n<li>New: The field limit retrieved from the Mailchimp API has been increased from 30 to 100.<\\/li>\\n<\\/ul>\\n<h4>v2.07 - June 11, 2024<\\/h4>\\n<ul>\\n<li>New: Field dropdowns have been updated to enable support for repeater actions.<\\/li>\\n<\\/ul>\\n<h4>v2.06 - June 23, 2021<\\/h4>\\n<ul>\\n<li>New: Name fields will now automatically map the proper first and last name values when sending to MailChimp.<\\/li>\\n<li>Fix: Prevent a warning when loading MailChimp action settings.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-mailchimp\\/formidable-mailchimp.php\",\"icons\":{\"1x\":\"https:\\/\\/formidableforms.com\\/wp-content\\/uploads\\/2013\\/04\\/mailchimp.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"172715\":{\"title\":\"PayPal Basic\",\"name\":\"PayPal Basic\",\"display_name\":\"PayPal Basic\",\"slug\":\"paypal-standard-single-payments\",\"version\":\"3.08\",\"new_version\":\"3.08\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-paypal\\/formidable-paypal-3.08.zip\"],\"excerpt\":\"\",\"id\":172715,\"released\":\"2015-10-21 12:20:35\",\"categories\":[\"Ecommerce\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/paypal-standard-single-payments\\/\",\"changelog\":\"<h4>v3.02 - September 14, 2018<\\/h4>\\n<ul>\\n<li>Merge the older grandfathered PayPal addon with the updated version.<\\/li>\\n<\\/ul>\\n<h4>v2.04.07 - January 25, 2015<\\/h4>\\n<ul>\\n<li>Allow amounts with . for thousands and , for decimal. If a . is used in the decimal place for the amount when the currency uses a , make it work anyway<\\/li>\\n<li>Redirect to PayPal correctly without Pro<\\/li>\\n<li>Make sure email setting is trimmed before comparing<\\/li>\\n<li>Add download ID to make sure correct license is used<\\/li>\\n<\\/ul>\\n<h4>v2.04.06 - November 17, 2015<\\/h4>\\n<ul>\\n<li>Prevent errors when updating Formidable<\\/li>\\n<\\/ul>\\n<h4>v2.04.05<\\/h4>\\n<ul>\\n<li>Format decimals with . to allow float to work correctly<\\/li>\\n<li>Get updates from FormidablePro.com<\\/li>\\n<\\/ul>\\n<h4>v2.04.04<\\/h4>\\n<ul>\\n<li>Allow the amount to be included in the \\\"other\\\" option<\\/li>\\n<li>Modify the user-agent in the IPN verification to prevent errors from PayPal<\\/li>\\n<\\/ul>\\n<h4>v2.04.03<\\/h4>\\n<ul>\\n<li>Save the IPN parameters with the payment in the format that allows for multiple IPN notifications<\\/li>\\n<li>Fix sending users to Paypal when 2.x is installed, but the old settings haven\'t been moved to a form action<\\/li>\\n<li>Increased security related to XSS add_query_arg vulnerability<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"paypal-standard-single-payments\\/paypal-standard-single-payments.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"173984\":{\"title\":\"User Registration\",\"name\":\"User Registration\",\"display_name\":\"User Registration\",\"slug\":\"user-registration\",\"version\":\"2.13\",\"new_version\":\"2.13\",\"location\":[\"s3.amazonaws.com\\/fp.strategy11.com\\/releases\\/formidable-registration\\/formidable-registration-2.13.zip\"],\"excerpt\":\"Give new users access to your site quickly and painlessly. Plus edit profiles and login from the front end.\",\"id\":173984,\"released\":\"2011-12-21 00:00:00\",\"categories\":[\"Business\",\"Data Collection\",\"Form Functionality\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/user-registration\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/user-registration\\/\",\"changelog\":\"<h4>v2.13 - April 4, 2024<\\/h4>\\n<ul>\\n<li>New: User moderation redirects now support a new option to Redirect to a URL.<\\/li>\\n<li>New: Links and forms have been updated to use the site URL for logging in instead of the network site URL.<\\/li>\\n<li>New: The &#091;frm-login] shortcode now support several new options including register_link, label_register, class_register for adding registration links to login forms.<\\/li>\\n<li>New: The logout_redirect option used in &#091;frm-login] shortcodes now supports numeric page ID values.<\\/li>\\n<li>New: &#091;frm-reset-password] shortcodes now support new password_strength=\\\"1\\\" and password_visibility_toggle=\\\"1\\\" options.<\\/li>\\n<li>Fix: Errors messages will now show on page load when using the slide=1 option with a &#091;frm-login] shortcode.<\\/li>\\n<li>Several old deprecated functions have been removed.<\\/li>\\n<\\/ul>\\n<h4>v2.12 - February 15, 2024<\\/h4>\\n<ul>\\n<li>Security: The &#091;frm-set-password-link] shortcode can no longer be used anywhere but in email actions. Any user without the frm_edit_users capability will also not be allowed to save a &#091;frm-set-password-link] shortcode as part of their email action content.<\\/li>\\n<li>New: The meta table displayed on the User Profile page has been updated to look better. It now also includes links to edit the Formidable entry in a new table column for users with the capability to edit entries on admin pages.<\\/li>\\n<li>Fix: User meta would not update when updating a field value using the &#091;frm-entry-update-field] shortcode.<\\/li>\\n<\\/ul>\\n<h4>v2.11 - November 1, 2023<\\/h4>\\n<ul>\\n<li>New: Translations have been added for Polish, Portuguese (Brazil), French, German, Dutch, Slovak, and Italian.<\\/li>\\n<li>New: Roles will no longer get added on entry update by default. This can be enabled with a new frm_reg_update_user_role hook.<\\/li>\\n<li>New: The way CSS is added has been modified for better compatibility with the Snuffleupagus security module.<\\/li>\\n<li>Fix: The error message for missing special characters when resetting a password would only show a Password is invalid message. The new message is now more detailed.<\\/li>\\n<li>Fix: When using the slide=1 option in frm-login shortcodes, the remember me and lost password elements would never appear.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-registration\\/formidable-registration.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"registration, user registration, register\",\"is_new\":false},\"174006\":{\"title\":\"WooCommerce\",\"name\":\"WooCommerce\",\"display_name\":\"WooCommerce\",\"slug\":\"woocommerce\",\"version\":\"1.12\",\"new_version\":\"1.12\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-woocommerce\\/formidable-woocommerce-1.12.zip\"],\"excerpt\":\"Are your WooCommerce product forms too basic? Add custom fields to a product form and collect more data when it is added to the cart.\",\"id\":174006,\"released\":\"2016-01-19 00:00:00\",\"categories\":[\"Ecommerce\",\"Elite\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-woocommerce\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/woocommerce\\/\",\"changelog\":\"\",\"plugin\":\"formidable-woocommerce\\/formidable-woocommerce.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"180495\":{\"title\":\"Highrise\",\"name\":\"Highrise\",\"display_name\":\"Highrise\",\"slug\":\"highrise\",\"version\":\"1.06\",\"new_version\":\"1.06\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-highrise\\/formidable-highrise-1.06.zip\"],\"excerpt\":\"Capture leads in your WordPress contact forms, and save them in your Highrise CRM account too.\",\"id\":180495,\"released\":\"2013-12-12 00:00:00\",\"categories\":[\"Creator\",\"CRM\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-highrise\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/highrise\\/\",\"changelog\":\"<h4>v1.06 - February 29, 2016<\\/h4>\\n<ul>\\n<li>Send the custom fields correctly to Highrise<\\/li>\\n<\\/ul>\\n<h4>v1.05 - February 23, 2016<\\/h4>\\n<ul>\\n<li>Fix email field settings in the Highrise action<\\/li>\\n<li>Make sure the license key is a Highrise license<\\/li>\\n<\\/ul>\\n<h4>v1.04 - February 9, 2016<\\/h4>\\n<ul>\\n<li>Added options to separate out address fields. City, State, Zip, and Country can now be mapped separately.<\\/li>\\n<li>Fixed PHP7 warnings<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-highrise\\/formidable-highrise.php\",\"icons\":{\"1x\":\"https:\\/\\/formidableforms.com\\/wp-content\\/uploads\\/2012\\/01\\/highrise.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"185013\":{\"title\":\"Bootstrap Modal\",\"name\":\"Bootstrap Modal\",\"display_name\":\"Bootstrap Modal\",\"slug\":\"bootstrap-modal\",\"version\":\"3.0.2\",\"new_version\":\"3.0.2\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-modal\\/formidable-modal-3.0.2.zip\"],\"excerpt\":\"Open forms, views, other shortcodes, or sections of content in a Bootstrap popup.\",\"id\":185013,\"released\":\"2015-08-26 00:00:00\",\"categories\":[\"Creator\",\"Form Design &amp; Display\",\"Form Functionality\",\"Strategy11\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/bootstrap-modal\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/bootstrap-modal\\/\",\"changelog\":\"<h4>v3.0.2 - December 11, 2023<\\/h4>\\n<ul>\\n<li>New: The modal block button will now have a default \\\"Click here\\\" text instead of an empty input to make quick testing easier.<\\/li>\\n<li>New: The modal close button will now longer appear in the block preview as it was getting in the way and served no purpose.<\\/li>\\n<li>New: The modal block has been updated to work better with white label settings.<\\/li>\\n<li>Fix: The autocomplete popup from the Formidable Geolocation add on would not appear inside of a Bootstrap modal because of a z-index issue.<\\/li>\\n<\\/ul>\\n<h4>v3.0.1 - June 26, 2023<\\/h4>\\n<ul>\\n<li>Fix: Modals were hidden when the Formidable Bootstrap add on was also active.<\\/li>\\n<li>Fix: Modals made with the [[frmmodal-content]] shortcode were missing a backdrop.<\\/li>\\n<\\/ul>\\n<h4>v3.0 - June 13, 2023<\\/h4>\\n<ul>\\n<li>New: A Gutenberg block has been added to make modals easier to embed.<\\/li>\\n<li>New: A new <span class=\\\"blob-code-inner blob-code-marker js-code-nav-pass \\\" data-code-marker=\\\"+\\\"><span class=\\\"pl-s x\\\">frm_modal_link<\\/span><\\/span> filter has been added for customizing the modal link trigger HTML.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-modal\\/formidable-modal.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"modal, popup\",\"is_new\":false},\"209561\":{\"title\":\"Polylang\",\"name\":\"Polylang\",\"display_name\":\"Polylang\",\"slug\":\"polylang\",\"version\":\"1.12\",\"new_version\":\"1.12\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-polylang\\/formidable-polylang-1.12.zip\"],\"excerpt\":\"Create bilingual or multilingual forms with help from Polylang.\",\"id\":209561,\"released\":\"2016-01-22 00:00:00\",\"categories\":[\"Business\",\"Multilingual\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/formidable-polylang\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/polylang\\/\",\"changelog\":\"<h4>v1.12 - August 19, 2024<\\/h4>\\n<ul>\\n<li>New: This plugin now includes translations for French, Spanish, Italian, German, Japanese and Brazilian Portuguese.<\\/li>\\n<li>Fix: A trim(): Passing null to parameter deprecated message when viewing a form has been fixed.<\\/li>\\n<\\/ul>\\n<h4>v1.11 - August 8, 2023<\\/h4>\\n<ul>\\n<li>New: Product options can now be translated.<\\/li>\\n<li>Fix: Likert columns were not translating when the \\\"Separate column values\\\" option was checked.<\\/li>\\n<\\/ul>\\n<h4>v1.10 - August 16, 2021<\\/h4>\\n<ul>\\n<li>New: Submitted options will now be translated for radio, checkbox and dropdown fields, including translated views and email actions.<\\/li>\\n<li>Fix: Added additional checks to prevent notices for fields missing placeholders.<\\/li>\\n<li>Fix: Prevent a warning that would trigger when uploading.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-polylang\\/frm-poly.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"310430\":{\"title\":\"Stripe\",\"name\":\"Stripe\",\"display_name\":\"Stripe\",\"slug\":\"stripe\",\"version\":\"3.1.5\",\"new_version\":\"3.1.5\",\"location\":[\"fp.strategy11.com\\/releases\\/formidable-stripe\\/formidable-stripe-3.1.5.zip\"],\"excerpt\":\"Any Formidable forms on your site can accept credit card payments without users ever leaving your site.\",\"id\":310430,\"released\":\"2016-04-26 00:00:00\",\"categories\":[\"Business\",\"Ecommerce\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/stripe\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/stripe\\/\",\"changelog\":\"<h4>v3.1.5 - March 7, 2024<\\/h4>\\n<ul>\\n<li>New: A new &#091;frm-payment] shortcode has been added. This can be used to display quick details about a payment for a given entry ID. For example, &#091;frm-payment entry=&#091;id] show=amount] can be used in a view to get the payment amount.<\\/li>\\n<li>New: The table output from the &#091;frm-subscriptions] shortcode is now responsive on mobile widths.<\\/li>\\n<li>New: Recurring payments now support a new \\\"Recurring Payment Limit\\\" setting. Once the limit has been reached, subscriptions will be automatically cancelled.<\\/li>\\n<li>New: The submit button will no longer be disabled when a Stripe link payment method field is conditionally hidden.<\\/li>\\n<li>Fix: Payments using a currency that uses a comma as the decimal separator would have an incorrect amount value when the amount value had a single decimal point like 11,5.<\\/li>\\n<li>Fix: After a recent Stripe update, forms with multiple payment actions would get stuck on a spinning button on submit.<\\/li>\\n<li>Fix: In some cases, a Stripe Link redirect would happen after failing to create an entry, resulting in an unexpected redirect to stripe.com.<\\/li>\\n<li>Fix: Subscription plan details would not update after changing the trial period.<\\/li>\\n<\\/ul>\\n<h4>v3.1.4 - January 23, 2024<\\/h4>\\n<ul>\\n<li>New: Embedded fields can now be used for customer information Name and Address options.<\\/li>\\n<li>New: Payments now support a test mode flag. New payments will display whether a payment was made in test mode or in live mode.<\\/li>\\n<li>New: A new payment refunded event trigger type has been added.<\\/li>\\n<li>New: Stripe subscriptions will now cancel at period end by default instead of cancelling immediately. This can be reverted to the previous behaviour using add_filter( \'frm_stripe_cancel_subscription_at_period_end\', \'__return_false\' );.<\\/li>\\n<li>New: Strings used in the embedded payments plugin can now be translated.<\\/li>\\n<li>Fix: After payment settings would never save properly for a new payment action.<\\/li>\\n<li>Fix: Some currency options were appearing multiple times.<\\/li>\\n<li>Fix: A subscription with a failed charge but a successful payment intent would incorrectly get flagged as a completed successful payment.<\\/li>\\n<li>Fix: An error message wouldn\'t properly appear when using a 3D secure card and failing the payment.<\\/li>\\n<li>Fix: [if x] shortcodes were not working in confirmation action redirects when x is the field ID of a field used for tracking payment status.<\\/li>\\n<li>Fix: Conditionally hidden fields would become visible after card is declined when AJAX submit was enabled.<\\/li>\\n<li>Fix: 3D secure payments would remain pending when a form included a confirmation action with a redirect.<\\/li>\\n<li>Fix: A conflict with the Authorize.Net add-on would trigger a Call to undefined method FrmTransAppHelper::get_formatted_amount_for_currency() fatal error.<\\/li>\\n<li>Many translations have been offloaded to Formidable Lite.<\\/li>\\n<\\/ul>\\n<h4>v3.1.3 - October 4, 2023<\\/h4>\\n<ul>\\n<li>Fix: Stripe subscriptions would fail with a No such plan error if the payment action was created when a different mode was active.<\\/li>\\n<li>Fix: Entries would not get deleted on Stripe payment failure, and old entry data would not get displayed with payment errors, when using Stripe Link or when using a 3D secure credit card.<\\/li>\\n<li>Fix: The payment expire date and next subscription billing date values were not accurate for payment table records when using Stripe Link.<\\/li>\\n<li>Fix: iDEAL, Bancontact, and SOFORT subscriptions would fail with a The payment method must be attached to the customer error.<\\/li>\\n<li>Fix: A return_url must be specified error would prevent the creation of payment intents when using API keys with newer versions of the Stripe API set.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-stripe\\/formidable-stripe.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"326042\":{\"title\":\"Form Action Automation\",\"name\":\"Form Action Automation\",\"display_name\":\"Form Action Automation\",\"slug\":\"autoresponder\",\"version\":\"2.08\",\"new_version\":\"2.08\",\"location\":[\"fp.strategy11.com\\/releases\\/autoresponder\\/formidable-autoresponder-2.08.zip\"],\"excerpt\":\"Schedule email notifications, SMS messages, and API actions.\",\"id\":326042,\"released\":\"2016-09-21 00:00:00\",\"categories\":[\"Automation\",\"Elite\",\"Marketing\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/schedule-autoresponder\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/autoresponder\\/\",\"changelog\":\"<h4>v2.08 - August 13, 2024<\\/h4>\\n<ul>\\n<li>New: This plugin now includes translations for French, Spanish, Italian, German, Japanese and Brazilian Portuguese.<\\/li>\\n<\\/ul>\\n<h4>v2.07 - April 29, 2024<\\/h4>\\n<ul>\\n<li>New: The frm_autoresponder_time filter is now always applied. Previously this filter was only used when date or time fields were defined as the send date setting.<\\/li>\\n<li>New: Strings used in this plugin can now be translated.<\\/li>\\n<li>Fix: A bug has been fixed that would strip &#091;] shortcode characters after duplicating a form action with dashes in the value like a date format.<\\/li>\\n<\\/ul>\\n<h4>v2.06 - January 2, 2024<\\/h4>\\n<ul>\\n<li>Fix: Some inputs had styling issues in Automation action settings.<\\/li>\\n<li>Fix: A delayed form action automation would sometimes never trigger when set to trigger 1 minute after form submission, when form actions after form submission would take longer than a minute to complete reporting that the time had already passed.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-autoresponder\\/formidable-autoresponder.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"automate, automation\",\"is_new\":false},\"337527\":{\"title\":\"Authorize.net AIM\",\"name\":\"Authorize.net AIM\",\"display_name\":\"Authorize.net AIM\",\"slug\":\"authorize-net-aim\",\"version\":\"2.03\",\"new_version\":\"2.03\",\"location\":[\"fp.strategy11.com\\/releases\\/authorize-net\\/formidable-authorize-net-2.03.zip\"],\"excerpt\":\"Accept one-time payments directly on your site, using Authorize.net AIM.\",\"id\":337527,\"released\":\"2016-04-29 00:00:00\",\"categories\":[\"Ecommerce\",\"Elite\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/authorize-net-aim\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/authorize-net-aim\\/\",\"changelog\":\"<h4>v2.03 - April 24, 2024<\\/h4>\\n<ul>\\n<li>Fix: A FrmTransActionsController not found fatal error related to autoloading occuring on some server configurations has been fixed.<\\/li>\\n<\\/ul>\\n<h4>v2.02 - March 7, 2022<\\/h4>\\n<ul>\\n<li>New: Name fields will now automatically map the proper first and last name values when sending to Authorize.net.<\\/li>\\n<li>New: Set the default currency to the one selected in global settings.<\\/li>\\n<li>New: Added additional currencies from Pro.<\\/li>\\n<li>Fix: Payments would not work if the amount specified was formatted as currency.<\\/li>\\n<li>Fix: Prevent a fatal error that happens in PHP8 when filling payment information.<\\/li>\\n<li>Fix: Expire dates were not properly calculating.<\\/li>\\n<li>Fix: Some echecks were not getting approved.<\\/li>\\n<li>Fix: Updated incorrect text domains.<\\/li>\\n<\\/ul>\\n<h4>v2.01 - March 18, 2019<\\/h4>\\n<ul>\\n<li>Fix: Increase the timeout for creating the payment on Authorize.net in order to prevent false failures.<\\/li>\\n<li>Save the full API response in the log instead of only the body of the response for more helpful debugging messages.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-authorize-net\\/formidable-authorize-net.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"Authorize.net\",\"is_new\":false},\"11927748\":{\"title\":\"Logs\",\"name\":\"Logs\",\"display_name\":\"Logs\",\"slug\":\"logs\",\"version\":\"1.0.2\",\"new_version\":\"1.0.2\",\"location\":[\"fp.strategy11.com\\/releases\\/logs\\/formidable-logs-1.0.2.zip\"],\"excerpt\":\"See your API requests along with their responses from add-ons including Zapier, Formidable API Webhooks, Salesforce and more.\",\"id\":11927748,\"released\":\"2016-12-19 00:00:00\",\"categories\":[\"Basic\",\"Strategy11\",\"Utilities\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/logging\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/logs\\/\",\"changelog\":\"\",\"plugin\":\"formidable-logs\\/formidable-logs.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"19366992\":{\"title\":\"Formidable Pro Elite Package\",\"name\":\"Formidable Pro Elite Package\",\"display_name\":\"Formidable Pro Elite Package\",\"slug\":\"formidable-pro-enterprise-package\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":19366992,\"releas