=\\\"days\\\" option. In order to count blocked out dates, you must now include a new count_blackout_dates=\\\"1\\\" option.<\\/li>\\n<li>New: The strings used in this add-on can now be translated.<\\/li>\\n<li>Fix: Date calculations would trigger an error pop up on the edit entry admin page.<\\/li>\\n<li>Fix: Some date field validation checks would fail when sending a date value in Y-m-d format instead of the global date format setting.<\\/li>\\n<li>Fix: When validating if a date value is greater than or less than today, the value for today was based on the UTC timezone instead of the server timezone.<\\/li>\\n<\\/ul>\\n<h4>v2.0.3 - November 6, 2023<\\/h4>\\n<ul>\\n<li>Fix: Some inline datepickers were breaking because of a <span class=\\\"message-body-wrapper\\\"><span class=\\\"message-flex-body\\\"><span class=\\\"message-body devtools-monospace\\\"><span class=\\\"objectBox-stackTrace reps-custom-format\\\" data-link-actor-id=\\\"server0.conn0.windowGlobal450971566097\\/obj74\\\"><span class=\\\"objectBox objectBox-string\\\">settings is undefined<\\/span><\\/span><\\/span><\\/span><\\/span> JavaScript error.<\\/li>\\n<\\/ul>\\n<h4>v2.0.2 - November 1, 2023<\\/h4>\\n<ul>\\n<li>New: Inline datepickers will now reset when the start over button is clicked.<\\/li>\\n<li>New: Date calculations will now automatically exclude blacked out dates. This can be disabled using a new frm_dates_skip_blocked_dates_from_calc filter.<\\/li>\\n<li>Fix: Date calculations would break in multiple page forms when the calculations are not on the first page.<\\/li>\\n<li>Fix: Clicking on the + icon to add blackout or exception dates would not trigger the datepicker pop up.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-dates\\/formidable-dates.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-154