.06.zip\"],\"excerpt\":\"Collect leads in WordPress forms and automatically add them in GetResponse. Then trigger automatic emails and other GetResponse marketing automations.\",\"id\":20813244,\"released\":\"2018-09-06 00:00:00\",\"categories\":[\"Business\",\"Email &amp; SMS Marketing\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/getresponse-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/getresponse-wordpress-plugin\\/\",\"changelog\":\"<h4>v1.06 - June 11, 2024<\\/h4>\\n<ul>\\n<li>New: Field dropdowns have been updated to enable support for repeater actions.<\\/li>\\n<li>New: Strings used in this plugin can now be translated.<\\/li>\\n<\\/ul>\\n<h4>v1.05 - June 21, 2021<\\/h4>\\n<ul>\\n<li>New: Name fields will now automatically map the proper first and last name values when sending to GetResponse.<\\/li>\\n<li>Fix: Nothing would get sent when a user id field was set to something other than a name or email option.<\\/li>\\n<\\/ul>\\n<h4>v1.04 - October 2, 2019<\\/h4>\\n<ul>\\n<li>Allow 0 for the cycle start day<\\/li>\\n<li>Show more helpful messages in the form action if the GetResponse lists cannot be fetched<\\/li>\\n<li>Update the form action icon for 4.0<\\/li>\\n<li>Remove the debug mode option and use the Logging plugin instead<\\/li>\\n<li>Load all custom fields right away since they aren\'t different for each list. Also don\'t hide the custom fields when a list changes.<\\/li>\\n<li>Prevent error with Formidable disabled<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-getresponse\\/formidable-getresponse.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"20815759\":{\"title\":\"Quiz Maker\",\"name\":\"Quiz Maker\",\"display_name\":\"Quiz Maker\",\"slug\":\"quiz-maker\",\"