te custom CSV files and allow users to export their data from the front-end of your site.\",\"id\":20897348,\"released\":\"2019-08-01 00:00:00\",\"categories\":[\"Business\",\"Data Management\",\"Strategy11\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/table-view-to-csv\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/export-view\\/\",\"changelog\":\"<h4>v1.10 - August 13, 2024<\\/h4>\\n<ul>\\n<li>New: This plugin now includes translations for French, Spanish, Italian, German, Japanese and Brazilian Portuguese.<\\/li>\\n<li>Checks have been added to avoid trying to extend the time limit when the set_time_limit function does not exist to improve compatibility.<\\/li>\\n<li>Several references to deprecated functions have been updated.<\\/li>\\n<\\/ul>\\n<h4>v1.09 - September 19, 2023<\\/h4>\\n<ul>\\n<li>New: A new UTF-8 with BOM format option has been added to the Export Views global settings section.<\\/li>\\n<\\/ul>\\n<h4>v1.08 - June 26, 2023<\\/h4>\\n<ul>\\n<li>Fix: Some admin pages, including the WooCommerce orders page, were broken because of a fatal error when Formidable Views was inactive. Now this plugin will no longer load when Formidable Views is unavailable.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-export-view\\/formidable-export-view.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"export table\",\"is_new\":false},\"26596685\":{\"title\":\"Directory\",\"name\":\"Directory\",\"display_name\":\"Directory\",\"slug\":\"directory\",\"version\":\"1.0.01\",\"new_version\":\"1.0.01\",\"location\":[\"fp.strategy11.com\\/releases\\/directory\\/formidable-directory-1.0.01.zip\"],\"excerpt\":\"\",\"id\":26596685,\"released\":\"2020-06-29 00:00:00\",\"categories\":[\"Business+Views\",\"Solution\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/formidable-directory\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/wordpress-directory-plugin\\/\",\"changelog\":\"<h4>v1.0.01 - October 4, 2021<\\/h4>\\n<ul>\\n<li>Fix: The frm-letter-filter shortcode would always filter by lname instead of using the custom param option.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-directory\\/formidable-directory.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"beta\":{\"version\":\"100\",\"location\":[\"fp.strategy11.com\\/form-templates\\/business-directory.xml\"]},\"is_new\":false},\"28027505\":{\"title\":\"Views\",\"name\":\"Views\",\"display_name\":\"Legacy Views\",\"slug\":\"views\",\"version\":\"4.0.05\",\"new_version\":\"4.0.05\",\"location\":[\"fp.strategy11.com\\/releases\\/views\\/formidable-views-4.0.05.zip\"],\"excerpt\":\"Add the power of views to your Formidable Forms to display your form submissions in listings, tables, calendars, and more.\",\"id\":28027505,\"released\":\"2010-10-28 00:00:00\",\"categories\":[\"Strategy11\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase-category\\/views\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/views\\/\",\"changelog\":\"<h4>v5.4.2 - October 25, 2023<\\/h4>\\n<ul>\\n<li>New: A new <span class=\\\"blob-code-inner blob-code-marker js-code-nav-pass \\\" data-code-marker=\\\"+\\\"><span class=\\\"pl-s\\\">frm_filter_final_view filter has been added for modifying the final result of a view.<\\/span><\\/span><\\/li>\\n<li>New: A few UI enhancements have been made. Now sliders for grid view settings include additional input fields with matching numeric values.<\\/li>\\n<li>New: The way CSS is added has been modified for better compatibility with the Snuffleupagus security module.<\\/li>\\n<li>New: The ID column is now sortable on the views list admin page.<\\/li>\\n<li>New: Some accessibility improvements have been added for view editor labels.<\\/li>\\n<li>New: A new filter has been added to support the new entry status types introduced with the form abandonment add on.<\\/li>\\n<li>Fix: Multiple warnings would get logged when sorting a view by a deleted field.<\\/li>\\n<li>Fix: Long view content would scroll underneath the type toggle elements.<\\/li>\\n<li>Fix: The preview result for address field shortcodes was not consistent with the front end result.<\\/li>\\n<li>Fix: The views editor would break with a fatal error when using the Google Listings and Ads plugin by WooCommerce. This conflict has been resolved.<\\/li>\\n<li>Fix: A Undefined array key PHP warning would get logged when loading the view editor if only a single view exists in the database.<\\/li>\\n<li>Fix: A deprecated use of self message would get logged when using the Gutenberg block for views.<\\/li>\\n<\\/ul>\\n<h4>v5.4 - March 13, 2023<\\/h4>\\n<ul>\\n<li>New: Added <span class=\\\"blob-code-inner blob-code-marker js-code-nav-pass \\\" data-code-marker=\\\"+\\\"><span class=\\\"pl-s\\\">frm_views_table_class<\\/span><\\/span> and <span class=\\\"blob-code-inner blob-code-marker js-code-nav-pass \\\" data-code-marker=\\\"+\\\"><span class=\\\"pl-s\\\">frm_display_inner_content_before_add_wrapper<\\/span><\\/span> filters.<\\/li>\\n<li>Fix: Prevent a PHP 8.2 deprecation message when handling hidden column screen option preferences for the table on the view list page.<\\/li>\\n<li>Fix: Detail page content would incorrectly be detected as not empty in grid views, causing issues with nested views displaying a \\\"No entries found\\\" message unexpectedly. This fix may require that a nested detail page with no content gets saved again in order to resolve.<\\/li>\\n<li>Updated styling so the visual view editor looks nicer with the v6.0 core update.<\\/li>\\n<li>Removed a deprecated jQuery function reference used when dismissing modals.<\\/li>\\n<\\/ul>\\n<h4>v5.2.1 - June 2, 2022<\\/h4>\\n<ul>\\n<li>New: Added a new Application column to the views list page.<\\/li>\\n<li>New: Improved support for the new Add\\/Edit Applications and Access Application Dashboard permission settings added in Pro.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-views\\/formidable-views.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"28029934\":{\"title\":\"Formidable Pro Basic\",\"name\":\"Formidable Pro Basic\",\"display_name\":\"Formidable Pro Basic\",\"slug\":\"formidable-basic2\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":28029934,\"released\":\"2020-11-13 12:10:10\",\"categories\":[],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-basic2\\/\",\"changelog\":\"\",\"plugin\":\"formidable-basic2\\/formidable-basic2.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"28058856\":{\"title\":\"Visual Views\",\"name\":\"Visual Views\",\"display_name\":\"Visual Views\",\"slug\":\"visual-views\",\"version\":\"5.6.2\",\"new_version\":\"5.6.2\",\"location\":[\"fp.strategy11.com\\/releases\\/views\\/formidable-views-5.6.2.zip\"],\"excerpt\":\"Create WordPress web apps to display your form submissions in grids, tables, calendars, and more.\",\"id\":28058856,\"released\":\"2021-05-31 00:00:00\",\"categories\":[\"Creator\",\"Data Management\",\"Strategy11\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase-category\\/views\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/visual-views\\/\",\"changelog\":\"<h4>v5.6.2 - July 29, 2024<\\/h4>\\n<ul>\\n<li>New: A new option to change a Calendar view to a legacy calendar has been added. \\\"Switch to Legacy\\\" can be found beside the type, in the top-left area of the visual views editor.<\\/li>\\n<li>New: Support for a new &#091;frm-letter-filter] shortcode has been added. This was previously included in the directory add-on. This can be used to add alphabetical filtering to a view.<\\/li>\\n<li>New: Screen reader text has been updated on the views list page to improve accessibility.<\\/li>\\n<li>Fix: Calendar views would incorrectly display impossible dates past 31 for the previous month in some cases.<\\/li>\\n<li>Fix: A missing div closing tag would cause invalid markup issues when displaying a calendar view.<\\/li>\\n<li>The FrmViewsDisplay::get_id_by_key function has been updated to avoid matches with non-view post types.<\\/li>\\n<\\/ul>\\n<h4>v5.6.1 - May 15, 2024<\\/h4>\\n<ul>\\n<li>Fix: A JavaScript error introduced in last release that would cause issues with editing some views has been fixed.<\\/li>\\n<\\/ul>\\n<h4>v5.6 - May 14, 2024<\\/h4>\\n<ul>\\n<li>New: A new Show Event Details Pop-up setting has been added to Calendar views, as well as several new settings for customizing the content of the new pop up.<\\/li>\\n<li>New: New settings have been added to customize Calendar views in the Gutenberg block editor.<\\/li>\\n<li>New: Support for map views has been added. This also requires v1.3 of the Geolocation add-on.<\\/li>\\n<li>New: Views now support a new option to refresh with AJAX when a form is submitted.<\\/li>\\n<li>New: Calendar views will now show a calendar preview in the visual views editor.<\\/li>\\n<li>New: Views sorted by random are now seeded. This allows for consistent randomized results when switching between multiple pages.<\\/li>\\n<li>New: The collapsible sections in the visual views editor have been updated to improve screen reader accessibility.<\\/li>\\n<li>Fix: Detail pages were not working as expected when using the offset setting.<\\/li>\\n<li>Fix: A JavaScript error would get triggered when dragging a table view column for forms without entries.<\\/li>\\n<li>Views sorted by random are now randomized with PHP instead of with SQL. This fixes a conflict with WP Engine hosting where ordering by random using SQL is disabled.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-views\\/formidable-views.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"28058858\":{\"title\":\"Formidable Views + Forms Basic\",\"name\":\"Formidable Views + Forms Basic\",\"display_name\":\"Formidable Views + Forms Basic\",\"slug\":\"formidable-views-basic\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":28058858,\"released\":\"2021-05-12 12:29:57\",\"categories\":[],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/formidable-views-basic\\/\",\"changelog\":\"\",\"plugin\":\"formidable-views-basic\\/formidable-views-basic.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"28058860\":{\"title\":\"Formidable Apps + Forms Elite\",\"name\":\"Formidable Apps + Forms Elite\",\"display_name\":\"Formidable Apps + Forms Elite\",\"slug\":\"formidable-views-elite\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":28058860,\"released\":\"2021-05-12 12:22:02\",\"categories\":[],\"docs\":\