s:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"28067256\":{\"title\":\"Surveys and Polls\",\"name\":\"Surveys and Polls\",\"display_name\":\"Surveys and Polls\",\"slug\":\"surveys\",\"version\":\"1.1.2\",\"new_version\":\"1.1.2\",\"location\":[\"fp.strategy11.com\\/releases\\/surveys\\/formidable-surveys-1.1.2.zip\"],\"excerpt\":\"Transform your WordPress site into a data collection machine with our user-friendly survey form builder.\",\"id\":28067256,\"released\":\"2021-09-16 00:00:00\",\"categories\":[\"Business\",\"Data Collection\",\"Strategy11\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/surveys-and-polls-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/surveys\\/\",\"changelog\":\"<h4>v1.1.2 - August 19, 2024<\\/h4>\\n<ul>\\n<li>New: This plugin now includes translations for French, Spanish, Italian, German, Japanese and Brazilian Portuguese.<\\/li>\\n<li>Fix: The icon and text for a selected radio button option would appear blank in the form builder preview when the display format was set to buttons.<\\/li>\\n<\\/ul>\\n<h4>v1.1.1 - May 30, 2024<\\/h4>\\n<ul>\\n<li>New: Ranking field dropdowns have been made slightly larger by default, to avoid issues where dropdown options would appear cut off on some browsers, including mobile browsers.<\\/li>\\n<li>New: Strings used in this plugin can now be translated.<\\/li>\\n<li>New: Field IDs for likert field questions are now displayed in the form builder for an easier reference.<\\/li>\\n<li>Fix: The wrong page would load when displaying errors for a required likert field.<\\/li>\\n<li>Fix: Likert field values would not appear in a view when used in an embedded form.<\\/li>\\n<li>A few field type checks have been optimized, fixing an issue where the form builder would take significantly more time to load forms with a lot of fields and conditional logic when the Surveys add-on was active.<\\/li>\\n<\\/ul>\\n<h4>v1.1 - March 12, 2024<\\/h4>\\n<ul>\\n<li>New: A new Ranking field type has been added. Now you can easily rank a list of options.<\\/li>\\n<li>Fix: In some cases likert rows would be missing from CSV exports.<\\/li>\\n<li>Fix: Read only radio buttons displayed as buttons no longer have hover styles.<\\/li>\\n<li>Fix: Unexpected empty boxes would appear in summary fields in forms with likert fields.<\\/li>\\n<li>The placeholder image is no longer visible on the front end when using the button display type with images and no image uploaded.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-surveys\\/formidable-surveys.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"28074303\":{\"title\":\"Landing Pages\",\"name\":\"Landing Pages\",\"display_name\":\"Landing Pages\",\"slug\":\"landing-pages\",\"version\":\"1.0.01\",\"new_version\":\"1.0.01\",\"location\":[\"fp.strategy11.com\\/releases\\/landing\\/formidable-landing-1.0.01.zip\"],\"excerpt\":\"Create beautiful landing pages fast and rake in new leads.\",\"id\":28074303,\"released\":\"2022-01-06 00:00:00\",\"categories\":[\"Creator\",\"Form Design &amp; Display\",\"Strategy11\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/landing-pages\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/landing-pages\\/\",\"changelog\":\"<p>No Changes Found<\\/p>\\n\",\"plugin\":\"formidable-landing\\/formidable-landing.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"28100793\":{\"title\":\"Conversational Forms\",\"name\":\"Conversational Forms\",\"display_name\":\"Conversational Forms\",\"slug\":\"conversational-forms\",\"version\":\"1.1.3\",\"new_version\":\"1.1.3\",\"location\":[\"fp.strategy11.com\\/releases\\/chat\\/formidable-chat-1.1.3.zip\"],\"excerpt\":\"Ask one question at a time to humanize forms and boost their conversion rates.\",\"id\":28100793,\"released\":\"2022-01-25 00:00:00\",\"categories\":[\"Business\",\"Form Design &amp; Display\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/conversational-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/conversational-forms\\/\",\"changelog\":\"<h4>v1.1.3 - April 18, 2024<\\/h4>\\n<ul>\\n<li>Fix: Submit button fields were appearing as a conversational form question. These are now skipped.<\\/li>\\n<li>Completed Turnstile CAPTCHA fields are now skipped automatically.<\\/li>\\n<\\/ul>\\n<h4>v1.1.2 - March 11, 2024<\\/h4>\\n<ul>\\n<li>Fix: A conditionally hidden field would be visible when inside of a conditionally visible section regardless of the conditional logic on the field itself.<\\/li>\\n<li>Fix: A conversational form would advance to the next question after a disabled radio button was clicked.<\\/li>\\n<li>Fix: A conversational form would break when clicking the previous button when the form included a quiz score field.<\\/li>\\n<\\/ul>\\n<h4>v1.1.1 - January 15, 2024<\\/h4>\\n<ul>\\n<li>New: Shortcodes can now be used in fields labels and HTML field descriptions in conversational forms without the need to add page breaks.<\\/li>\\n<li>New: The way CSS is added has been updated for better compatibility with the Snuffleupagus security module.<\\/li>\\n<li>Fix: Fields that have associated likert data but are no longer children of a likert field were not rendering as expected in a conversational form, appearing on the start page instead.<\\/li>\\n<li>Fix: An attempt to read property \\\"id\\\" on null PHP warning has been fixed.<\\/li>\\n<li>Fix: Radio buttons in sections would get partially cut off in a conversational form.<\\/li>\\n<li>Fix: Remove buttons were never appearing in repeaters in conversational forms.<\\/li>\\n<li>Fix: SVG icons were not properly getting copied in repeater add\\/remove buttons in conversational forms.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-chat\\/formidable-chat.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"28118399\":{\"title\":\"Geolocation\",\"name\":\"Geolocation\",\"display_name\":\"Geolocation\",\"slug\":\"geolocation\",\"version\":\"1.3.1\",\"new_version\":\"1.3.1\",\"location\":[\"fp.strategy11.com\\/releases\\/geo\\/formidable-geo-1.3.1.zip\"],\"excerpt\":\"Get more accurate data and make forms faster to complete with address autocomplete.\",\"id\":28118399,\"released\":\"2022-04-12 00:00:00\",\"categories\":[\"Business\",\"Data Collection\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/geolocation\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/geolocation\\/\",\"changelog\":\"<h4>v1.3.1 - July 29, 2024<\\/h4>\\n<ul>\\n<li>New: Maps will now reset when the start over button is clicked.<\\/li>\\n<li>New: Google map scripts are now loaded asynchronously, allowing pages to load quicker.<\\/li>\\n<li>New: The deprecated google.maps.Marker function is no longer used.<\\/li>\\n<li>New: Latitude and longitude data will now properly import when importing XML data.<\\/li>\\n<li>New: Map views now support shortcodes.<\\/li>\\n<li>New: Additional checks have been added to ensure translated country names will match country values in address field country dropdowns by comparing country codes when there isn\'t a country name match.<\\/li>\\n<li>New: Map view pop ups no longer include an x icon to close the pop up and close when another area is clicked now instead.<\\/li>\\n<li>Map view marker tooltips displayed on hover will no longer include HTML code.<\\/li>\\n<\\/ul>\\n<h4>v1.3 - May 14, 2024<\\/h4>\\n<ul>\\n<li>New: Support for a new map view type has been added. This also requires version 5.6 of Visual Views.<\\/li>\\n<li>New: When the line1 input in an Address field is empty, the place name will be used for the line1 value instead. And when using a text field, the place name will always be added unless the place name was already included. This is useful for getting more accurate autofill results for some location types including airports.<\\/li>\\n<li>Fix: The show=\\\"lat\\\" and show=\\\"long\\\" options were not working when used in email actions.<\\/li>\\n<\\/ul>\\n<h4>v1.2.1 - January 15, 2024<\\/h4>\\n<ul>\\n<li>New: Autocomplete results are no longer restricted to only show geocoding results. This setting was preventing some search result types including locations like the Eiffel Tower and the Great Wall of China. A new frm_geo_autocomplete_options filter has been added to make this more flexible, as well as a few new helper functions. To restore the previous autocomplete behaviour, use add_filter( \'frm_geo_autocomplete_options\', \'FrmGeoAppController::use_geocode_autocomplete_type\' );.<\\/li>\\n<li>New: Fewer fields will be retrieved when making API requests. This should help to reduce API-related costs.<\\/li>\\n<li>New: Addresses with subpremise address details will now conditionally populate additional information either as part of the street number like 10\\/27, or as part of line2 for values like \\\"apt 123\\\".<\\/li>\\n<li>New: The exact latitude and longitude will now be used when dragging and dropping a pin marker.<\\/li>\\n<li>New: The map will now update to show the geocoded match result when processing a visitor\'s location.<\\/li>\\n<li>Fix: The fallback default location will no longer get set when editing an entry and declining to use the visitor\'s location.<\\/li>\\n