:43\",\"categories\":[\"Solution\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/link-in-bio-instagram-grid\\/\",\"changelog\":\"\",\"plugin\":\"link-in-bio-instagram-grid\\/link-in-bio-instagram-grid.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"28136428\":{\"title\":\"PDFs\",\"name\":\"PDFs\",\"display_name\":\"PDFs\",\"slug\":\"pdfs\",\"version\":\"2.0.4\",\"new_version\":\"2.0.4\",\"location\":[\"fp.strategy11.com\\/releases\\/pdfs\\/formidable-pdfs-2.0.4.zip\"],\"excerpt\":\"Create PDFs from form entries automatically. Email them or let visitors download PDFs from your site.\",\"id\":28136428,\"released\":\"2022-08-09 00:00:00\",\"categories\":[\"Business\",\"Data Management\",\"Utilities\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/pdfs\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/pdfs\\/\",\"changelog\":\"<h4>v2.0.4 - June 6, 2024<\\/h4>\\n<ul>\\n<li>New: PDFs can now load images without requiring the allow_url_fopen PHP directive.<\\/li>\\n<li>New: Additional shortcode attribute data is now passed to the frm_pdfs_css filter as additional $args data.<\\/li>\\n<li>Fix: Checks have been added to avoid fatal errors when trying to extend the time limit when the function is disabled.<\\/li>\\n<li>An update has been made to improve compatibility with QR code created using https:\\/\\/api.qrserver.com\\/. A new frm_pdfs_dompdf_should_encode_uri filter has been added to allow additional exceptions.<\\/li>\\n<\\/ul>\\n<h4>v2.0.3 - December 14, 2023<\\/h4>\\n<ul>\\n<li>Fix: An update in the previous release caused PDFs with special characters to appear broken with unexpected characters in place.<\\/li>\\n<\\/ul>\\n<h4>v2.0.2 - December 13, 2023<\\/h4>\\n<ul>\\n<li>New: PDF shortcodes now support a show_pagination=1 option. When this is included, pagination will be added to each page.<\\/li>\\n<li>New: New frm_pdfs_before_render and frm_pdfs_after_render actions have been added to allow for customization of PDFs with code. This allows developers to add custom page_script calls in their custom code.<\\/li>\\n<li>Fix: SVG icons would appear blank in generated PDFs. This included thumbnails for some file types including docx and xlsx, as well as star rating icons.<\\/li>\\n<li>Fix: Images would appear broken in generated PDFs when file protection was enabled.<\\/li>\\n<li>Fix: Grid views would trigger fatal errors when generating PDFs.<\\/li>\\n<li>Fix: A conflict with the iThemes Security plugin would block images in generated PDFs.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-pdfs\\/formidable-pdfs.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"28144027\":{\"title\":\"Member Directory\",\"name\":\"Member Directory\",\"display_name\":\"Member Directory\",\"slug\":\"member-directory\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":28144027,\"released\":\"2022-08-24 15:18:56\",\"categories\":[\"Solution\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/member-directory\\/\",\"changelog\":\"\",\"plugin\":\"member-directory\\/member-directory.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"28144089\":{\"title\":\"Business Directory\",\"name\":\"Business Directory\",\"display_name\":\"Business Directory\",\"slug\":\"business-directory\",\"version\":\"\",\"new_version\":\"\",\"location\":[],\"excerpt\":\"\",\"id\":28144089,\"released\":\"2022-08-24 16:41:02\",\"categories\":[\"Solution\",\"Strategy11\"],\"docs\":\"\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/business-directory\\/\",\"changelog\":\"\",\"plugin\":\"business-directory\\/business-directory.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"28149579\":{\"title\":\"Google Sheets\",\"name\":\"Google Sheets\",\"display_name\":\"Google Sheets\",\"slug\":\"google-sheets\",\"version\":\"1.0.3\",\"new_version\":\"1.0.3\",\"location\":[\"fp.strategy11.com\\/releases\\/google-sheets\\/formidable-googlespreadsheet-1.0.3.zip\"],\"excerpt\":\"Send form entries to a Google spreadsheet as a backup or for extra processing.\",\"id\":28149579,\"released\":\"2022-10-18 00:00:00\",\"categories\":[\"Business\",\"Data Management\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/google-spreadsheet-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/google-sheets\\/\",\"changelog\":\"<h4>v1.0.3 - September 3, 2024<\\/h4>\\n<ul>\\n<li>New: This plugin now includes translations for French, Spanish, Italian, German, Japanese and Brazilian Portuguese.<\\/li>\\n<li>New: A fallback solution has been added to enable authentication on some sites where pop ups are disallowed.<\\/li>\\n<li>Extra spaces will be trimmed when adding Client ID and Client Secret values to help prevent errors related to copying extra whitespace.<\\/li>\\n<\\/ul>\\n<h4>v1.0.2 - October 18, 2023<\\/h4>\\n<ul>\\n<li>New: Currency symbols in total fields are no longer sent as encoded HTML entities. These symbols will now appear in Google Sheets as the proper symbol.<\\/li>\\n<li>Fix: Signature field shortcodes would always display a signature as a URL instead of an image when the Google Sheets add on was active.<\\/li>\\n<\\/ul>\\n<h4>v1.0.1 - February 9, 2023<\\/h4>\\n<ul>\\n<li>Fix: Trying to deactivate Google Sheets wouldn\'t work if removed from the Google console first with an error stating that deauthorization failed.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-googlespreadsheet\\/formidable-googlespreadsheet.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":false},\"28158728\":{\"title\":\"ACF Forms\",\"name\":\"ACF Forms\",\"display_name\":\"ACF Forms\",\"slug\":\"acf-forms\",\"version\":\"1.0.2\",\"new_version\":\"1.0.2\",\"location\":[\"fp.strategy11.com\\/releases\\/acf\\/formidable-acf-1.0.2.zip\"],\"excerpt\":\"Sync custom fields between Formidable and Advanced Custom Fields or ACF Pro.\",\"id\":28158728,\"released\":\"2022-12-13 00:00:00\",\"categories\":[\"Business\",\"Data Management\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/acf-form\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/acf-forms\\/\",\"changelog\":\"<h4>v1.0.2 - August 13, 2024<\\/h4>\\n<ul>\\n<li>New: This plugin now includes translations for French, Spanish, Italian, German, Japanese and Brazilian Portuguese.<\\/li>\\n<li>Fix: Values were not getting added to an ACF repeater when the setting to store Formidable entries is disabled.<\\/li>\\n<\\/ul>\\n<h4>v1.0.1 - July 6, 2023<\\/h4>\\n<ul>\\n<li>Fix: Repeater values were not appearing for posts until the post was manually updated.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-acf\\/formidable-acf.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"advanced, custom fields\",\"is_new\":false},\"28189169\":{\"title\":\"AI\",\"name\":\"AI\",\"display_name\":\"AI Forms\",\"slug\":\"ai\",\"version\":\"2.0\",\"new_version\":\"2.0\",\"location\":[\"fp.strategy11.com\\/releases\\/ai\\/formidable-ai-2.0.zip\"],\"excerpt\":\"Get back your time by autogenerating a response from ChatGPT and inserting it into a field.\",\"id\":28189169,\"released\":\"2023-04-11 00:00:00\",\"categories\":[\"Automation\",\"Business\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/form-ai\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/ai\\/\",\"changelog\":\"<h4>v2.0 - August 13, 2024<\\/h4>\\n<ul>\\n<li>New: A new Create with AI button has been added to the form templates page, located beside the Create a blank form button. This button will prompt a new modal that will generate a basic form based on user input.<\\/li>\\n<li>New: AI fields now include a new GPT Model setting. This setting supports gpt-3.5-turbo and gpt-4o-mini model options. gpt-3.5-turbo is typically faster and more succinct, and gpt-4o-mini has higher quality responses.<\\/li>\\n<li>New: The watched fields setting has been replaced with a new AI Question text area setting. This update makes it easier to build questions with multiple fields and static text. This setting accepts field shortcodes that update in real time that will re-trigger the AI prompt when updated.<\\/li>\\n<li>New: The Guide Prompt setting now accepts field shortcodes that work with live form values.<\\/li>\\n<li>New: AI fields will not reset when the start over button is clicked.<\\/li>\\n<li>Fix: AI fields inside of embedded fields were not working.<\\/li>\\n<li>Fix: AI fields now properly accept layout classes and work when dragged into groups with other fields.<\\/li>\\n<li>Fix: AI field requests would fail when the WPML add-on was active.<\\/li>\\n<li>Fix: AI fields requests were not happening after changing a watched date field value.<\\/li>\\n<\\/ul>\\n<h4>v1.0.1 - May 3, 2023<\\/h4>\\n<ul>\\n<li>New: AI fields will now watch more types of fields including address fields, name fields, radio buttons, dropdowns, checkboxes, embedded fields.<\\/li>\\n<li>New: Line breaks in AI responses will now be preserved.<\\/li>\\n<li>Fix: A missing null check would cause a JavaScript error to break some forms when the AI answer isn\'t included in the form.<\\/li>\\n<li>An ongoing AI request will now be aborted early when a new request begins.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-ai\\/formidable-ai.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"chatgpt, openai, automate\",\"is_new\":false},\"28217763\":{\"title\":\"Abandonment\",\"name\":\"Abandonment\",\"display_name\":\"Form Abandonment\",\"slug\":\"abandonment\",\"version\":\"1.1.3\",\"new_version\":\"1.1.3\",\"location\":[\"fp.strategy11.com\\/releases\\/abandonment\\/formidable-abandonment-1.1.3.zip\"],\"excerpt\":\"Capture form data before it\'s submitted to save more leads and optimize forms. Plus, auto save drafts and allow logged out editing.\",\"id\":28217763,\"released\":\"2023-10-24 00:00:00\",\"categories\":[\"Business\",\"Data Collection\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/form-abandonment\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/abandonment\\/\",\"changelog\":\"<h4>v1.1.3 - April 16, 2024<\\/h4>\\n<ul>\\n<li>Fix: Forms with repeaters would change to submitted status after auto-saving, resulting in a \\\"You do not have permission to view this form\\\" error after submitting the form for users that are not logged in.<\\/li>\\n<\\/ul>\\n<h4>v1.1.2 - March 11, 2024<\\/h4>\\n<ul>\\n<li>Fix: Checkbox values were not properly saving when auto-saving form data.<\\/li>\\n<li>Fix: Actions that trigger when an entry is created would not trigger as expected when changing from In-Progress status to Submitted status.<\\/li>\\n<\\/ul>\\n<h4>v1.1.1 - February 27, 2024<\\/h4>\\n<ul>\\n<li>Fix: A new entry would get created on every autosave event when the form included redirect confirmation actions.<\\/li>\\n<li>Fix: Create actions would trigger instead of update actions on entry update when the abandonment plugin was active.<\\/li>\\n<li>Fix: The created_at entry value would update every time an entry is updated when the abandonment plugin was active.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-abandonment\\/formidable-abandonment.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"partial, save, continue\",\"is_new\":false},\"28248560\":{\"title\":\"Charts\",\"name\":\"Charts\",\"display_name\":\"Charts\",\"slug\":\"charts\",\"version\":\"1.0.2\",\"new_version\":\"1.0.2\",\"location\":[\"fp.strategy11.com\\/releases\\/charts\\/formidable-charts-1.0.2.zip\"],\"excerpt\":\"Transform form data into insightful graphs with ease.\",\"id\":28248560,\"released\":\"2024-01-09 00:00:00\",\"categories\":[\"Creator\",\"Data Management\"],\"docs\":\"https:\\/\\/formidableforms.com\\/knowledgebase\\/graphs\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/charts\\/\",\"changelog\":\"<h4>v1.0.2 - April 29, 2024<\\/h4>\\n<ul>\\n<li>New: Field options can now be dragged and dropped to define which order they are applied in the graph.<\\/li>\\n<li>Fix: Apostrophes used for title options were getting encoded as HTML entities.<\\/li>\\n<li>Fix: Long form names would cause UI issues in the data source dropdown.<\\/li>\\n<\\/ul>\\n<h4>v1.0.1 - March 11, 2024<\\/h4>\\n<ul>\\n<li>New: The data type dropdown setting now supports new options for the highest and lowest values in a set.<\\/li>\\n<li>Fix: The horizontal axis data source was not saving as expected.<\\/li>\\n<\\/ul>\\n\",\"plugin\":\"formidable-charts\\/formidable-charts.php\",\"icons\":{\"1x\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/icon-256x256.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"graph\",\"is_new\":false},\"28286367\":{\"title\":\"ConvertKit\",\"name\":\"ConvertKit\",\"display_name\":\"ConvertKit\",\"slug\":\"convertkit\",\"version\":\"1.0\",\"new_version\":\"1.0\",\"location\":[\"fp.strategy11.com\\/releases\\/convertkit\\/formidable-convertkit-1.0.zip\"],\"excerpt\":\"Bring automation into your email marketing plan for the power to say \\\"welcome\\\" to your subscribers the moment they opt-in to your list.\",\"id\":28286367,\"released\":\"2024-07-09 08:50:54\",\"categories\":[\"Creator\",\"Email &amp; SMS Marketing\",\"Strategy11\"],\"docs\":\"\\/knowledgebase\\/convertkit-forms\\/\",\"link\":\"https:\\/\\/formidableforms.com\\/downloads\\/convertkit\\/\",\"changelog\":\"<p>No Changes Found<\\/p>\\n\",\"plugin\":\"formidable-convertkit\\/formidable-convertkit.php\",\"icons\":{\"1x\":\"https:\\/\\/formidableforms.com\\/wp-content\\/uploads\\/2013\\/04\\/mailchimp.png\"},\"banners\":{\"high\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\",\"low\":\"https:\\/\\/ps.w.org\\/formidable\\/assets\\/banner-1544x500.png\"},\"search_terms\":\"\",\"is_new\":true},\"response_code\":200}\";s:7:\"version\";s:4:\"6.14\";}', 'off');
